import React from 'react'
import Navbar from '../layouts/Navbar'
import { MDBCard, MDBContainer, MDBListGroup, MDBListGroupItem, MDBNavbar, MDBNavbarBrand, MDBNavbarItem, MDBTypography } from 'mdb-react-ui-kit'

export function CheckoutNoAcc() {
    return (
        <div>
            <Navbar />

            <div>
                {stickyFooter()}
            </div>
        </div>
    )
}

export function CheckoutWithAcc() {
    return (
        <div>
            <Navbar></Navbar>
            <div>

                {stickyFooter()}
            </div>
        </div>
    )
}

function stickyFooter() {
    return (
        <div className='shadow-4-strong fixed-bottom d-flex justify-content-end'>
            <MDBListGroup flush className=" align-items-end w-75">
                <MDBListGroupItem className='border-0'>
                    <MDBTypography className='mb-0 float-start'> Thành tiền</MDBTypography>
                    <MDBTypography className='mb-0 float-end'> 127.300 đ</MDBTypography>
                </MDBListGroupItem>
                <MDBListGroupItem className='border-0'>
                    <MDBTypography className='float-start'>
                        Giảm giá (Nhập mã thành công - Mã giảm giá 10% - Đơn hàng từ 100K - Khi mua Sách Học Ngoại Ngữ)
                    </MDBTypography>
                    <MDBTypography className='mb-0 float-end'> -10.000 đ</MDBTypography>
                </MDBListGroupItem>
                <MDBListGroupItem className='border-0'>
                    <MDBTypography className='mb-0 float-start'> Phí vận chuyển (Giao hàng tiêu chuẩn)</MDBTypography>
                    <MDBTypography className='mb-0 float-end'> 18.000 đ</MDBTypography>
                </MDBListGroupItem>
            </MDBListGroup>
        </div>
    )
}
